import requestsimport jsondef return_repos():    response = requests.get(url='https://api.bitbucket.org/2.0/repositories')    data = response.json()['values']        return_list = [];    for page in data:        return_list.append(page['links']['html']['href'])            return return_listdef return_repo_user(username):    response = requests.get(url='https://api.bitbucket.org/2.0/repositories/' + username)    data = response.json()['values']        return_list = [];    for page in data:        return_list.append(page['links']['html']['href'])            return return_listdef return_repo_pulls(repo):    response = requests.get(url=repo + "/pullrequests")    return response.json()['values']def main():    print(return_repo_pulls('https://api.bitbucket.org/2.0/repositories/evzijst/git-tests'))    main()